import  order  from './order';
import  postPokemon  from './postPokemon';
import searchByName from './searchByName';
import select from './select';


const combineReducer = (state={}, action)=>{
    return(
        {
            pokemon: searchByName(state.recipe, action),
            select: select(state.recipe, action),
            postPokemons: postPokemon(state.recipe, action),
            order: order(state.recipe, action)
        }
    )
}
export default combineReducer;
